function About () {
  return (
    <div>
      <h2>Acerca de nuestro Sitio Web</h2>
      <p>
      Nuestros socios y socias son muy importantes para nosotros, ya que conforman un grupo de empresas, profesionales y soluciones con una amplísima oferta de productos y servicios. Te contamos quiénes son.  
      </p>
    </div>
  );
};

export default About;
